import React from 'react';

export default function CreateEvent() {
  const events = Array(3).fill(0);
  return (
    <div className="create-event">
      {events.map((_, index) => (
        <div className="event-card" key={index}>
          <div className="event-image"></div>
          <h3>Create Event {index + 1}</h3>
          <p>Fill details to launch</p>
          <button className="book-btn">Create</button>
        </div>
      ))}
    </div>
  );
}
